
const CLIENT_ID='1091611837858-sbt44ue42qsqtuf975kd5548nodal0sf';const API_KEY='AIzaSyDzC_2TZeWjkzrzFg3ZtSRP-kT8cB3LsvU';const DISCOVERY_DOCS=["https://www.googleapis.com/discovery/v1/apis/drive/v3/rest"];const SCOPES='profile https://www.googleapis.com/auth/drive.readonly';function startApp(){console.log("Starting app...");gapi.load('client:auth2:picker',function(){initClient();initAuth2();});};function initClient(){console.log("Initializing client...");gapi.client.init({apiKey:API_KEY,discoveryDocs:DISCOVERY_DOCS});}
function initAuth2(){console.log("Initializing auth2...");gapi.auth2.init({client_id:CLIENT_ID+'.apps.googleusercontent.com',scope:SCOPES});attachSignin(document.getElementById('signInButton'));}
function attachSignin(element){console.log("Attaching Google sign in to "+element.id+"...");var auth=gapi.auth2.getAuthInstance();auth.attachClickHandler(element,{},function(googleUser){console.log("Signed in: "+googleUser.getBasicProfile().getName());createPicker(googleUser);},function(error){alert(JSON.stringify(error,undefined,2));});}
function createPicker(googleUser){console.log("Creating file picker...");new google.picker.PickerBuilder().addView(google.picker.ViewId.SPREADSHEETS).setOAuthToken(googleUser.getAuthResponse().access_token).setDeveloperKey(API_KEY).setCallback(pickerCallback).build().setVisible(true);}
function pickerCallback(data){if(data[google.picker.Response.ACTION]==google.picker.Action.PICKED){var doc=data[google.picker.Response.DOCUMENTS][0];console.log("Selected document with name: "+doc.name);getFile(doc.id);}}
function getFile(id){console.log("Retreiving file with ID: "+id);gapi.client.drive.files.export({fileId:id,mimeType:"text/tab-separated-values"}).then(function(response){console.log("File imported:\n"+JSON.stringify(response.body));parseSubmissions(JSON.stringify(response.body));setupSelector();}).catch(err=>console.log(err));}